CREATE DEFINER=`jarvis`@`%` PROCEDURE `doctor_exists`(
in		p_login			varchar(100),
in		p_password		varchar(100),
out		p_is_exists		boolean
)
BEGIN
	set @cnt = 0;
	select count(1) into @cnt from doctor where login = p_login and (password = md5(p_password) or p_password is null);
    if @cnt = 0 then
		set p_is_exists = false;
	else
		set p_is_exists	= true;
	end if;
END ;;
