			gender 			= if(p_gender 			is null, gender, 			p_gender),
			diagnosis 		= if(p_diagnosis 		is null, diagnosis, 		p_diagnosis),
			comments 		= if(p_comments 		is null, comments, 			p_comments),
			discharge_date 	= if(p_discharge_date 	is null, discharge_date, 	p_discharge_date)
		where id = p_id;
    end if;
END ;;
